import React from 'react';
import "./VideoPlayer.scss";

function VideoPlayer({ title, channel, image, id, VideoFn }) {
  return (
    <div className="videoplayer" onClick={() => { VideoFn(id); }}>
      <div className="videoplayer__flex">
        <img className="videoplayer__flex-image" src={image} alt={title} />
      </div>

      <div className="videoplayer__container">
        <h4 className="videoplayer__container-title">{title}</h4>
        <p className="videoplayer__container-channel">{channel}</p>
      </div>
    </div>
  );
}

export default VideoPlayer;
